import React from 'react'



function popup(props) {
  return (props.trigger) ? (
    <>
    <div className='popup'>
        <div className='innertext'>
            <div className='close'>close</div>
            {props.children}
        </div>
    </div>
    </>
  ) : "";
}

export default popup
